import React from 'react';
import './Progress.css';



 function progressCalc(data) {
     let array = [];
     let runningAndCompleted = 0;
     let failed = 0;
     for (var i = 0; i <= data.length; i++) {
         for (var k in data[i]) {
             if (k = 'Status') {
                 if (data[i][k] == 'TimeOut' || data[i][k] == 'Completed' || data[i][k] == 'Running') {
                     runningAndCompleted++;
                 }
             }
         }
     }
     for (var z = 0; z <= data.length; z++) {
         for (var b in data[z]) {
             if (b = 'Result') {
                 if (data[i][b] == 'FailWithException') {
                     failed += data[i][k];
                 }
             }
         }

         array[0] = Math.round((runningAndCompleted / data.length) * 100);
         array[1] = failed;
     }
 }
     const Progress = (props) => {


         return (
             <div>
                 <div className="containerStatus">
                     <div className="ui two column centered grid">
                         <div className="column">
                             <div className="ui segment">Progress:{progressCalc(props.data)[0]} %</div>
                         </div>
                         <div className="column">
                             <div className="ui segment">Failed: {progressCalc(props.data)[1]}</div>
                         </div>
                     </div>
                 </div>
                 <div className="containerStatus">
                     <div className="ui two column centered grid">
                         <div className="column">
                             <div className="ui segment">PassRate:</div>
                         </div>
                     </div>
                 </div>
             </div>
         )
     }


export default Progress;
